import React from "react";

function star() {
  return (
    <span>
      <i
        class={
          value >= 1
            ? "fa-solid fa-star"
            : value >= 0.5
            ? "fa-regular fa-star"
            : "fa-regular fa-star-half-stroke"
        }
      ></i>
    </span>
  );
}

const Rating = ({ value, text }) => {
  const ratings = [0, 1, 2, 3, 4];
  console.log(ratings);
  return (
    <div className="rating">
      <span>
        <i
          class={
            value >= 1
              ? "fa-solid fa-star"
              : value >= 0.5
              ? "fa-regular fa-star"
              : "fa-regular fa-star-half-stroke"
          }
        ></i>
      </span>

      {ratings.map((r) => {
        <h1>{r}</h1>;
      })}

      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
